import React, { Component } from "react";
import {
  Button,
  Input,
  Container,
  Grid,
  AppBar,
  Toolbar,
  TextField
} from "@material-ui/core";

class Header extends Component {
  state = {
    textInput: ""
  };

  inputHandle(event) {
    if (event.target.value) {
      this.setState({ textInput: event.target.value });
    }
  }
  render() {
    return (
      <div>
        <AppBar position="static" color="primary">
          <Grid color="primary">
            <Toolbar>
              <Button onClick={() => console.log("OK")}>Home</Button>
              <Button>Contact</Button>
              <Button>About</Button>
              <Button>Login</Button>
              <Button>Register</Button>
            </Toolbar>
          </Grid>
        </AppBar>

        <Container>
          <Button
            variant="contained"
            color="primary"
            onClick={() => console.log(this.textInput)}
          >
            Hello World
          </Button>
          <TextField onChange={this.inputHandle} />
        </Container>
      </div>
    );
  }
}

export default Header;
